INSERT INTO `st_status` (`statusId`, `name`, `description`, `email`) VALUES
(0, 'Attente', 'La demande a été soumise au système et est en attente de vérification et de traitement par un administrateur.', ''),
(1, 'Preuves validées', 'La demande a été traitée et les preuves fournies on été validées par un administrateur. Une décision sera prise quand à la nature et à la priorité de votre demande.', ''),
(2, 'Refus', 'Votre demande a été refusée. Cela peut être dû à plusieurs facteurs, incluant la date d''émission de la demande et la forte quantité de demandes de stationnement pour l''année scolaire en cours. ', ''),
(3, 'Acceptée', 'Votre demande de stationnement a été acceptée. Cette dernière devra être payée avant d''être validée et émise par l''administration.    ', ''),
(4, 'Payée', 'Votre demande a été acceptée et payée. Elle vous sera disponible sous peu après son impression. ', ''),
(5, 'Imprimée', 'Votre demande a été imprimée est est maintenant disponible.', ''),
(6, 'Preuves invalides', 'Votre demande a été traitée, mais certaines preuves sont manquantes ou invalides. Veullez vous référer aux détails fournis  et soumettre des preuves valides en conséquence.', ''),
(7, 'Annulée', 'Vous avez décidé d''annuler votre demande. Une demande annulée ne sera pas traitée par l''administration, mais sera quand même conservée. Vous pouvez réactiver votre demande en tout temps.', '');
